import './App.css';
import Home from './page/Home';
import Login from './page/Login';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
    <Routes>

<Route path='/' element={<Home/>}/>
<Route path='/login' element={<Login/>}/>



    </Routes>

    </BrowserRouter>

  );
}

export default App;
